    constructor(props){
        super(props);
        this.state =  { 
            input: 'input'
        }
    }



    componentDidMount(){
        return console.log("cmd montée")
    }

    render() {
        return (
            <div id="Cmd" className="">
                <div id="Cmd-text-area" class="text-area">
                    <code id="Cmd-Input" className="">
                        <input className="cmd-input" type="text" placeholder="Write a command">
                        </input>
                    </code>
                    <br />
                    <code  id="Cmd-Output" className="output"></code>
                    ${this.state.input}

                </div>
            </div>
        );


    }
};


export default Cmd;
